(41, 'Wheel of Fortune (USA) ROM ', 'Wheel-of-Fortune', 'There are several Wheel of Fortune games available for the NES. This one does not seem to be the best. It lacks some of the fun that isThere are several Wheel of Fortune games available for the NES. This one does not seem to be the best. It lacks some of the fun that is present in the alternatives, but gameplay is very similar to them.\r\nIt follows the older rules of the game show (1980''''s rules), and has weaker graphics and sound than in the other WoF games. The third round is a speed round. This game will give players an option of which rules they prefer, but has little else to recommend it over its competitors.', 'nes', '/apps/emulators/jsnes/roms/Wheel_of_Fortune.nes', '/images/roms/nes/Wheel_of_Fortune(1).png,/images/roms/nes/Wheel_of_Fortune(2).png,/images/roms/nes/Wheel_of_Fortune(3).png,/images/roms/nes/Wheel_of_Fortune(4).png,/images/roms/nes/Wheel_of_Fortune(5).png'),
(42, 'Contra (USA) ROM ', 'Contra', 'Contra in my opinion, is one of the best shoot''''em ups out there, and still probably is. I even despised shooters, and I was still thouroughlyContra in my opinion, is one of the best shoot''''em ups out there, and still probably is. I even despised shooters, and I was still thouroughly content with this game. The controls are intuitive, and not difficult to handle, a plus considering the stiffness of other NES games. You can also collect red letter''''s with wings that give you different guns(My favorite is S :P) and are also allowed to shoot in multiple directions. The visuals are also quite detailed, considering it platforms on the NES, and the quality is much like the Castlevania games of the NES.\r\nBe warned, as you are in for one heck of a ride, bullets coming at you at every conceivable angle, traps and pits that can get in you''''re way, and the fact that one hit kills you, and takes away your meager 3 lives (Which can be brought to 30 if you use the Konami Code.)\r\nSadly, this game is ', 'nes', '/apps/emulators/jsnes/roms/Contra.nes', '/images/roms/nes/Contra(1).png,/images/roms/nes/Contra(2).jpg,/images/roms/nes/Contra(3).png,/images/roms/nes/Contra(4).jpg,/images/roms/nes/Contra(5).png,/images/roms/nes/Contra(6).png,/images/roms/nes/Contra(7).png,/images/roms/nes/Contra(8).png,/images/roms/nes/Contra(9).jpg'),
(43, 'Mike Tyson''''s Punch-Out!! (USA) ROM ', 'Mike-Tyson''''s-Punch-Out!!', 'Punch-Out!! features a boxer named Little Mac working his way up the professional boxing circuits, facing a series of colorful, fictional boxers, leading to a final fight with real-life boxer, the then-World Heavyweight Champion, which is Mike Tyson in this original version and Mr. Dream in the later version.Mike Tyson''''s Punch-Out is a boxing game for the NES. You play as Little Mac. You are a small boxer. You must box your way through various opponents. The ultimate goal is to defeat Mike Tyson. You will go through circuits defeating opponents and winning belts. You can punch, dodge, and block attacks. You must try to knock-out or get a TKO on your opponent. Punch-Out is a very fun boxing game. This game is amazing!! I had discovered this game on a NesterDC Dreamcast ISO I had downloaded here.\r\nThe controls are so responsive, and the gameplay is amazing! My family and I are addicted to this game! The end fight is so hard! Download this game and try it out!', 'nes', '/apps/emulators/jsnes/roms/Mike_Tyson''''s_Punch-Out!!.nes', '/images/roms/nes/Mike_Tyson''''s_Punch-Out!!(1).jpg,/images/roms/nes/Mike_Tyson''''s_Punch-Out!!(2).jpg,/images/roms/nes/Mike_Tyson''''s_Punch-Out!!(3).jpg,/images/roms/nes/Mike_Tyson''''s_Punch-Out!!(4).jpg,/images/roms/nes/Mike_Tyson''''s_Punch-Out!!(5).jpg,/images/roms/nes/Mike_Tyson''''s_Punch-Out!!(6).jpg,/images/roms/nes/Mike_Tyson''''s_Punch-Out!!(7).jpg,/images/roms/nes/Mike_Tyson''''s_Punch-Out!!(8).png,/images/roms/nes/Mike_Tyson''''s_Punch-Out!!(9).jpg,/images/roms/nes/Mike_Tyson''''s_Punch-Out!!(10).jpg'),
(44, 'Battletoads (USA) ROM ', 'Battletoads', 'A NES game of legendary difficulty in which different levels of the game have very different play styles. There are a few 3D and traditional 2D beat-em-up levels in which the player progresses by defeating enemies, though even these levels tend to have many lethal obstacles. The most difficult levels are the obstacle course and race levels, where the character must dodge a series of obstacles while driving or flying at high speed, or outrun an enemy that can instantly kill the player. These levels typically required the player to memorize the sequence of obstacles in the way, and to have extremely rapid reflexes. Other levels include a climbing/jumping snake maze, an underwater level with lethal spikes and dangerous monsters, and two difficult tower climb levels, including the final climb of the Dark Queen''''s tower.If you''''re one of those guys who likes some hard games to try out your abilites, you''''ve just found a real challenge. Battletoads is known as one of the most difficult games', 'nes', '/apps/emulators/jsnes/roms/Battletoads.nes', '/images/roms/nes/Battletoads(1).png,/images/roms/nes/Battletoads(2).png,/images/roms/nes/Battletoads(3).jpg,/images/roms/nes/Battletoads(4).png,/images/roms/nes/Battletoads(5).png,/images/roms/nes/Battletoads(6).png,/images/roms/nes/Battletoads(7).png,/images/roms/nes/Battletoads(8).png'),
(45, 'Final Fantasy (USA) ROM ', 'Final-Fantasy', 'An evil shroud covers the world in darkness. You must restoreAn evil shroud covers the world in darkness. You must restore the powers of earth, wind, fire and water to the Four Orbs. Create your own band of 4 Light Warriors from fighters, thieves, martial artists, and magicians. You''''ll need all their skills to triumph in this massive role-playing adventure. Your treaterous journey takes you to all parts of a strange new world. Explore dangerous castles and dark caverns where dadly perils and great rewards, await at every turn. Hundreds of ferocious monsters block your path. With patience, skill, and cunning, you can defeat them.One of the most influencial RPG''''s in history, Final Fantasy is a huge series today. This game is where it all started, singlehandedly pulling Square out of bankruptcy (which is why it was called Final Fantasy... they thought it would be their last game.) The music, battle mechanics, and story would be iconic traits for all Final Fantasy games that would follow', 'nes', '/apps/emulators/jsnes/roms/Final_Fantasy.nes', '/images/roms/nes/Final_Fantasy(1).jpg,/images/roms/nes/Final_Fantasy(2).jpg,/images/roms/nes/Final_Fantasy(3).jpg,/images/roms/nes/Final_Fantasy(4).jpg,/images/roms/nes/Final_Fantasy(5).jpg,/images/roms/nes/Final_Fantasy(6).jpg,/images/roms/nes/Final_Fantasy(7).jpg,/images/roms/nes/Final_Fantasy(8).jpg'),
(46, 'Tetris (USA) ROM ', 'Tetris', 'Tetris is the grandfather of puzzle video gaming, originally designed and programmed by Alexey Tetris is the grandfather of puzzle video gaming, originally designed and programmed by Alexey Pajitnov in the Soviet Union. He derived its name from the Greek numerical prefix tetra- (all of the game''''s pieces, known as Tetrominoes, contain four segments) and tennis, Pajitnov''''s favorite sport.', 'nes', '/apps/emulators/jsnes/roms/Tetris.nes', '/images/roms/nes/Tetris(1).png'),
(47, 'Teenage Mutant Ninja Turtles (USA) ROM ', 'Teenage-Mutant-Ninja-Turtles', 'Carnivorous robots chow-down in China Town, while brutal Ninjitsu Warriors, blood descendants of the deadly Foot Clan, bust-up bystanders from the Bronx to Broadway. Police SWAT Teams can''''t stop them, but the Teenage Mutant Ninja Turtles can! ''''Cause, powered by slices of pizza, they''''re always ready to rumble - with nunchukus, Katana Blades, and a party bus loaded with Anti-Foot Clan Missiles. So team up with the turtles, Raphael, Leonardo, Michaelangelo and Donatello, then switch on the tortoise radar, following your map and sixth sense past savage traps and secret sewage passages. Knock heads with the nasty Ninjitsu and either splatter them senseless or get yourself turned into turtle soup!The gameplay in Teenage Mutant Ninja Turtles begins with an overhead view similar to that found in RPGs for navigation, switching to a side view whenever the Turtle being controlled enters a manhole or a building—much like the two different perspectives found in Zelda II: The Adventure of Link.', 'nes', '/apps/emulators/jsnes/roms/Teenage_Mutant_Ninja_Turtles.nes', '/images/roms/nes/Teenage_Mutant_Ninja_Turtles(1).jpg'),
(48, 'Duck Tales (USA) ROM ', 'Duck-Tales', 'A cartoon game that felt Capcom''''s love. They had a knack for producing  good licensed titles, and this is one of them. You are Scrooge McDuck on  a 2D platforming quest for more money. If it looks and feels like Mega  Man, that''''s no coincidence, they were done by the sameA cartoon game that felt Capcom''''s love. They had a knack for producing  good licensed titles, and this is one of them. You are Scrooge McDuck on  a 2D platforming quest for more money. If it looks and feels like Mega  Man, that''''s no coincidence, they were done by the same team.Not to be dismissed as a cheap Disney cash-in, this is a suprisingly well-made game that still holds up even today. An action/platformer at it''''s core, you''''ll find plenty of replayability in seeking out as much treasure as possible. From the jungle to the moon, it''''s a great ride from start to finish!', 'nes', '/apps/emulators/jsnes/roms/Duck_Tales.nes', '/images/roms/nes/Duck_Tales(1).jpg,/images/roms/nes/Duck_Tales(2).png,/images/roms/nes/Duck_Tales(3).png,/images/roms/nes/Duck_Tales(4).png,/images/roms/nes/Duck_Tales(5).jpg'),
(49, 'Teenage Mutant Ninja Turtles II - The Arcade Game (USA) ROM ', 'Teenage-Mutant-Ninja-Turtles-II---The-Arcade-Game', '', 'nes', '/apps/emulators/jsnes/roms/Teenage_Mutant_Ninja_Turtles_II_-_The_Arcade_Game.nes', '/images/roms/nes/Teenage_Mutant_Ninja_Turtles_II_-_The_Arcade_Game(1).jpg,/images/roms/nes/Teenage_Mutant_Ninja_Turtles_II_-_The_Arcade_Game(2).jpg,/images/roms/nes/Teenage_Mutant_Ninja_Turtles_II_-_The_Arcade_Game(3).jpg,/images/roms/nes/Teenage_Mutant_Ninja_Turtles_II_-_The_Arcade_Game(4).jpg,/images/roms/nes/Teenage_Mutant_Ninja_Turtles_II_-_The_Arcade_Game(5).jpg,/images/roms/nes/Teenage_Mutant_Ninja_Turtles_II_-_The_Arcade_Game(6).jpg'),
(50, 'Metal Gear (USA) ROM ', 'Metal-Gear', 'The player must navigate the main character, a military operative codenamed Solid Snake, through various locations, while avoiding visual contact and direct confrontation with patrolling guards. If the player is seen, the game enters the Alert Mode. In this situation, Snake must escape from enemy''''s sight in order to resume infiltration. The method of escaping varies depending on the circumstances behind discovery. Another classic game of difficulty for the NES and a must have. Download it!', 'nes', '/apps/emulators/jsnes/roms/Metal_Gear.nes', '/images/roms/nes/Metal_Gear(1).jpg,/images/roms/nes/Metal_Gear(2).png,/images/roms/nes/Metal_Gear(3).jpg,/images/roms/nes/Metal_Gear(4).png,/images/roms/nes/Metal_Gear(5).png,/images/roms/nes/Metal_Gear(6).png,/images/roms/nes/Metal_Gear(7).png,/images/roms/nes/Metal_Gear(8).png'),
(51, 'Bomberman (USA) ROM ', 'Bomberman', 'Rope, lamp oil... BOMBS? You want them? Yes, of course you do! You want them by thousands. You''''ll need them to blow the living f*** out EVERY THING THAT MOVES.\r\nBomber Man is a game developed by Hudson Soft. You handle the Bomber Man, who places and activates explosives bigger than him around a maze trying to find a door to advance to the next level. Find powerups lying beneath bricks to make the game a lot easier and your experience a lot more fun.\r\nIt doesn''''t have a lot going for it, really, given that all the levels look the same with different layouts and the fact that it only has a one-square wave song throughout doesn''''t really help it. The theme song is as catchy as it gets, though.\r\nStill, it sets the foundations for a series of awesome, colorful and rich gameplay games with multiplayer events, and for that, it deserves to be played and remembered.\r\nGive it a go, you''''ll like it.', 'nes', '/apps/emulators/jsnes/roms/Bomberman.nes', '/images/roms/nes/Bomberman(1).jpg,/images/roms/nes/Bomberman(2).jpg,/images/roms/nes/Bomberman(3).jpg'),
(52, 'Teenage Mutant Ninja Turtles III - The Manhattan Project (USA) ROM ', 'Teenage-Mutant-Ninja-Turtles-III---The-Manhattan-Project', 'Surf''''s up, dude! The Teenage Mutant Ninja Turtles make a little getaway to the Sunshine State. Until Shredder makes a majorSurf''''s up, dude! The Teenage Mutant Ninja Turtles make a little getaway to the Sunshine State. Until Shredder makes a major getaway with the entire island of Manhattan! His power hungry plot gets even more bogus when April O''''Neil becomes part of the heist. What a relaxing vacation. Not! Those mondo mutants must make waves to get back home to save April and Manhattan, and send Shredder on a one way trip to geeksville! So unless you want Shredder to ninja-kick sand in your face and make off with your best girl and your hometown, you better get busy. Squashing him once and for all will be no holiday.', 'nes', '/apps/emulators/jsnes/roms/Teenage_Mutant_Ninja_Turtles_III_-_The_Manhattan_Project.nes', '/images/roms/nes/Teenage_Mutant_Ninja_Turtles_III_-_The_Manhattan_Project(1).jpg,/images/roms/nes/Teenage_Mutant_Ninja_Turtles_III_-_The_Manhattan_Project(2).jpg'),
(53, 'Bubble Bobble (USA) ROM ', 'Bubble-Bobble', 'You control a dragon that shoots bubbles (of saliva?) from its mouth.  You can capture monsters in the bubbles who then float around the screen in the bubble.  You have to jump on the bubble to pop itYou control a dragon that shoots bubbles (of saliva?) from its mouth.  You can capture monsters in the bubbles who then float around the screen in the bubble.  You have to jump on the bubble to pop it with the monster in it who then turns into a piece of fruit that falls to the floor.  If you wait too long the bubble will turn red and the monster will come back angry and fast.  If you wait too long to complete the stage, a skeletal shark appears and hunts you down.  You can''''t avoid him and if you don''''t beat the stage before he hits you, you lose a life.  Once all the monsters on the stage are popped, you proceed to the next stage.', 'nes', '/apps/emulators/jsnes/roms/Bubble_Bobble.nes', '/images/roms/nes/Bubble_Bobble(1).jpg,/images/roms/nes/Bubble_Bobble(2).jpg,/images/roms/nes/Bubble_Bobble(3).jpg,/images/roms/nes/Bubble_Bobble(4).jpg,/images/roms/nes/Bubble_Bobble(5).jpg,/images/roms/nes/Bubble_Bobble(6).jpg,/images/roms/nes/Bubble_Bobble(7).jpg,/images/roms/nes/Bubble_Bobble(8).jpg,/images/roms/nes/Bubble_Bobble(9).png'),
(54, 'Chip ''''n Dale Rescue Rangers (USA) ROM ', 'Chip-n-Dale-Rescue-Rangers', '', 'nes', '/apps/emulators/jsnes/roms/Chip_n_Dale_Rescue_Rangers.nes', '/images/roms/nes/Chip_''''n_Dale_Rescue_Rangers(1).png,/images/roms/nes/Chip_''''n_Dale_Rescue_Rangers(2).jpg,/images/roms/nes/Chip_''''n_Dale_Rescue_Rangers(3).png'),
(55, 'Batman - The Video Game (USA) ROM ', 'Batman---The-Video-Game', 'He''''s totally new. Totally tough. And he''''ll stop at nothing to make sure justice prevails! From the dark streets ofHe''''s totally new. Totally tough. And he''''ll stop at nothing to make sure justice prevails! From the dark streets of GOTHAM CITY to the deepest corners of the criminal underworld comes the CAPED CRUSADER as you''''ve never seen him before. Incredibly strong. Armed to the teeth. And ready to put his life on the line for the sake of all, on a search-and-destroy mission to end the Joker''''s reign of terror. He leaps, he flies, he dodges enemy fire and delivers it right back... with a vengeance. This is no kid stuff. This is as real as video gaming gets. If you liked what you saw in the movie, you''''re gonna love what you see here. Because this time around, BATMAN is all business, and he won''''t let anything stand in his way', 'nes', '/apps/emulators/jsnes/roms/Batman_-_The_Video_Game.nes', '/images/roms/nes/Batman_-_The_Video_Game(1).jpg,/images/roms/nes/Batman_-_The_Video_Game(2).jpg,/images/roms/nes/Batman_-_The_Video_Game(3).jpg,/images/roms/nes/Batman_-_The_Video_Game(4).jpg,/images/roms/nes/Batman_-_The_Video_Game(5).jpg,/images/roms/nes/Batman_-_The_Video_Game(6).jpg,/images/roms/nes/Batman_-_The_Video_Game(7).jpg,/images/roms/nes/Batman_-_The_Video_Game(8).jpg'),
(56, 'Earthbound (USA) (Proto) ROM ', 'Earthbound', 'Earthbound(USA)(Proto) is the first game of the Earthbound series. You play as Ninten, defeating enemies, protecting the lands, saving people from monsters, ghosts, zombies, moving lamps, Starmans, hippies, and so on, and getting money to use to pay for after defeatingEarthbound(USA)(Proto) is the first game of the Earthbound series. You play as Ninten, defeating enemies, protecting the lands, saving people from monsters, ghosts, zombies, moving lamps, Starmans, hippies, and so on, and getting money to use to pay for after defeating enemies. There are many things to do in this game.', 'nes', '/apps/emulators/jsnes/roms/Earthbound.nes', '/images/roms/nes/Earthbound(1).jpg,/images/roms/nes/Earthbound(2).jpg,/images/roms/nes/Earthbound(3).jpg,/images/roms/nes/Earthbound(4).jpg,/images/roms/nes/Earthbound(5).jpg,/images/roms/nes/Earthbound(6).jpg,/images/roms/nes/Earthbound(7).jpg,/images/roms/nes/Earthbound(8).jpg,/images/roms/nes/Earthbound(9).png,/images/roms/nes/Earthbound(10).jpg'),
(57, 'Dragon Warrior (USA) ROM ', 'Dragon-Warrior', 'A.K.A. Dragon Quest, the definitive JRPG. Still pretty fun, and more fair than Final Fantasy NES (which has dem insta-kills man).A.K.A. Dragon Quest, the definitive JRPG. Still pretty fun, and more fair than Final Fantasy NES (which has dem insta-kills man). Takes inspiration from Wizardry and Ultima.  No parties here, you''''re all alone. Prepare for some hefty grind, both  for levels and weapons. If you aren''''t tough and patient enough for this  bad boy, consider trying the easier GBC or SNES version, both of which  come with Dragon Quest II.Dragon Warrior...the epic beginning of a new era in video games. The Dragon-lord has captured the Princess and stolen Erdrick''''s powerful ball of light. You are Erdrick''''s heir. To you has fallen the most dangerous task - to rescue the King''''s daughter and recover the mystic ball of light. Your mission is deadly, but it is your fate. Use cunning and wisdom to choose your commands. Gain experience, weapons, and armor as you battle your way through t', 'nes', '/apps/emulators/jsnes/roms/Dragon_Warrior.nes', '/images/roms/nes/Dragon_Warrior(1).jpg,/images/roms/nes/Dragon_Warrior(2).jpg,/images/roms/nes/Dragon_Warrior(3).png,/images/roms/nes/Dragon_Warrior(4).jpg,/images/roms/nes/Dragon_Warrior(5).jpg,/images/roms/nes/Dragon_Warrior(6).png,/images/roms/nes/Dragon_Warrior(7).jpg,/images/roms/nes/Dragon_Warrior(8).jpg,/images/roms/nes/Dragon_Warrior(9).jpg,/images/roms/nes/Dragon_Warrior(10).jpg'),
