(59, 'Kung Fu (USA) ROM ', 'Kung-Fu', 'Kung Fu is just what you would expect from the title and console. Basically the story doesn''''t really matter, but you are going to the top of a tower to rescue your girlfriend. The graphics are okay, but are very limited due to the year of the release I assume. The sound effects are pretty good I think, but the music is sort of lacking. The game is very short, but it''''s basically a point-based game anyway. Overall, a classic side-scroller. If you want to play a classic beat em up, look no further.', 'nes', '/apps/emulators/jsnes/roms/Kung_Fu.nes', '/images/roms/nes/Kung_Fu(1).jpg,/images/roms/nes/Kung_Fu(2).jpg,/images/roms/nes/Kung_Fu(3).png,/images/roms/nes/Kung_Fu(4).png,/images/roms/nes/Kung_Fu(5).jpg,/images/roms/nes/Kung_Fu(6).jpg'),
