(62, 'Contra Force (USA) ROM ', 'Contra-Force', 'Contra Force is a contra game, but a depature from the series. YouContra Force is a contra game, but a depature from the series. You can choose to play from four characters. Each that have their own attributes and set of weapons. This game is very tough, the controls are stiff and the screen does not scroll smoothley. The graphics and sound are ok. Skip this one and play one of the better Contra games.  ', 'nes', '/apps/emulators/jsnes/roms/Contra_Force.nes', '/images/roms/nes/Contra_Force(1).png,/images/roms/nes/Contra_Force(2).png,/images/roms/nes/Contra_Force(3).png,/images/roms/nes/Contra_Force(4).png,/images/roms/nes/Contra_Force(5).png,/images/roms/nes/Contra_Force(6).png,/images/roms/nes/Contra_Force(7).png,/images/roms/nes/Contra_Force(8).png,/images/roms/nes/Contra_Force(9).png,/images/roms/nes/Contra_Force(10).png'),
(63, 'Duck Tales 2 (USA) ROM ', 'Duck-Tales-2', 'Everybody knows Duck Tales, but few have played the sequel.  Developed by a different team, and while sharing the same engine and  basic gameplay, it is considered by most people to be worse than its  prequel. That said, the songs aren''''t as catchy, but are moody, fit theEverybody knows Duck Tales, but few have played the sequel.  Developed by a different team, and while sharing the same engine and  basic gameplay, it is considered by most people to be worse than its  prequel. That said, the songs aren''''t as catchy, but are moody, fit the  themes of the stages, and set a great atmosphere. Graphics are more  detailed than in the first one. The level design is more intricate and  holds many more secrets, the placement of enemy is better thought, and  the hit detection, which was a bit clunky in the original, was fixed.  Whichever title of the two you think is best, chances are that if you  like one of them, you''''ll also enjoy the other.', 'nes', '/apps/emulators/jsnes/roms/Duck_Tales_2.nes', '/images/roms/nes/Duck_Tales_2(1).png,/images/roms/nes/Duck_Tales_2(2).png,/images/roms/nes/Duck_Tales_2(3).png,/images/roms/nes/Duck_Tales_2(4).png,/images/roms/nes/Duck_Tales_2(5).png,/images/roms/nes/Duck_Tales_2(6).png,/images/roms/nes/Duck_Tales_2(7).png,/images/roms/nes/Duck_Tales_2(8).png,/images/roms/nes/Duck_Tales_2(9).png'),
(64, 'Final Fantasy VII (C) ROM ', 'Final-Fantasy-VII', 'To begin with, this is the original Japanese copy of the game. In 2005, a company (wont be named) created a bootleg version of Final Fantasy VII for the NES. There are many scenes omitted, the game is incredibly unforgiving, and need to grinding is high. There are no airships, and theTo begin with, this is the original Japanese copy of the game. In 2005, a company (wont be named) created a bootleg version of Final Fantasy VII for the NES. There are many scenes omitted, the game is incredibly unforgiving, and need to grinding is high. There are no airships, and the only vehicle you have is only for a short time.  The weapons and huge materia quests are omitted as well. Oh yea, and Yuffie and Vincent are gone too :(.  The chocobo races, summons, and limit breaks are also gone.  And all gear can be bought from shops.  This version mainly uses sprites from the first three NES Final Fantasy games.Final Fantasy VII NES was a bootleg game created by Shenzhen Nanjing tech using sprites and mus', 'nes', '/apps/emulators/jsnes/roms/Final_Fantasy_VII.nes', '/images/roms/nes/Final_Fantasy_VII(1).jpg,/images/roms/nes/Final_Fantasy_VII(2).png,/images/roms/nes/Final_Fantasy_VII(3).png,/images/roms/nes/Final_Fantasy_VII(4).png,/images/roms/nes/Final_Fantasy_VII(5).png,/images/roms/nes/Final_Fantasy_VII(6).png'),
