(68, 'Dragon Warrior IV (USA) ROM ', 'Dragon-Warrior-IV', 'The fouth installment of the Dragon Warrior series, this game is a  LOT different from theThe fouth installment of the Dragon Warrior series, this game is a  LOT different from the first three games. No longer do you have class  changing, but you do have different classes of characters. Also, you  play the game like a story with 5 chapters.\r\nYou play as a soldier  who must find out why children are disappearing across the country; a  princess, along with her two consorts, trying to prove her strength; a  merchant trying to own his own shop; two sisters seeking revenge for  their father''''s death, and finally, you, the hero, who must stop the  great evil in the world!\r\nPersonally one of my favorite games of  the Dragon Quest series, you get a lot more story involved in this game.  You learn a little about your partymates thanks to playing as them in  each chapter. You get to employ different strategies as your team shifts  until they all come together in the final chapter, where you gain', 'nes', '/apps/emulators/jsnes/roms/Dragon_Warrior_IV.nes', '/images/roms/nes/Dragon_Warrior_IV(1).jpg,/images/roms/nes/Dragon_Warrior_IV(2).jpg,/images/roms/nes/Dragon_Warrior_IV(3).jpg,/images/roms/nes/Dragon_Warrior_IV(4).jpg,/images/roms/nes/Dragon_Warrior_IV(5).png,/images/roms/nes/Dragon_Warrior_IV(6).png,/images/roms/nes/Dragon_Warrior_IV(7).jpg'),
