(70, 'Battletoads & Double Dragon - The Ultimate Team (USA) ROM ', 'Battletoads-&-Double-Dragon---The-Ultimate-Team', 'Battletoads & Double Dragon: The Ultimate Team is a 1993 beat ''''em up developed by Rare&Battletoads & Double Dragon: The Ultimate Team is a 1993 beat ''''em up developed by Rare and published byTradewest. This ultimate crossover consist of Tradewest double dragon experts of martial arts Billy with his unmatchable twisting typhoon kick and Jimmy with his catastrophic knee drop, and rare’s brute fighting toads: The crazy and super cool Rash, The smartest of the three Zitz and Pimple the powerful brute.\r\nThe Dark Queen (battletoads series) has allied herself with the Shadow Warriors (from the Double Dragon series) to rule the earth and the galaxy and it’s up to the Ultimate Team to stop them\r\nYou can choose one or two (coop) characters of the five to go against t against robots, punks and rats and a boss at the end of each level using the characters fighting abilities in a fun beat ‘em up. It is also a 2D platformer where you can go in bikes avoiding obstacles, rappel in a factory avoiding ', 'nes', '/apps/emulators/jsnes/roms/Battletoads_&_Double_Dragon_-_The_Ultimate_Team.nes', '/images/roms/nes/Battletoads_&_Double_Dragon_-_The_Ultimate_Team(1).jpg,/images/roms/nes/Battletoads_&_Double_Dragon_-_The_Ultimate_Team(2).png'),
(71, 'R.C. Pro-Am (USA) ROM ', 'RC.-Pro-Am', 'R.C. Pro-Arm is a R.C. racing game. You will race around different tracks trying to take first place in each race. Along each race,R.C. Pro-Arm is a R.C. racing game. You will race around different tracks trying to take first place in each race. Along each race, there are power-ups you can get to boost your points, there also hazards that can slow you down or spin you out. Before each race you will see how your stats are upgraded. R.C. is a fun game for racing fans. ', 'nes', '/apps/emulators/jsnes/roms/R.C._Pro-Am.nes', '/images/roms/nes/RC._Pro-Am(1).png,/images/roms/nes/RC._Pro-Am(2).png,/images/roms/nes/RC._Pro-Am(3).jpg,/images/roms/nes/RC._Pro-Am(4).png,/images/roms/nes/RC._Pro-Am(5).png,/images/roms/nes/RC._Pro-Am(6).png,/images/roms/nes/RC._Pro-Am(7).png,/images/roms/nes/RC._Pro-Am(8).png,/images/roms/nes/RC._Pro-Am(9).jpg,/images/roms/nes/RC._Pro-Am(10).png'),
(72, 'Crystalis (USA) ROM ', 'Crystalis', 'This is a great game, making you an adventurer trying to save the world from destruction, you''''re pittedThis is a great game, making you an adventurer trying to save the world from destruction, you''''re pitted against many monsters and must gain a point value for each promotion, which results in better equipment, armor, shields, swords and special items to help you accomplish your task, it is pretty difficult, but worth the effort.What a cult classic! The Legend of Zelda makes sweet, passionate love to Final Fantasy and you have one beautiful baby named Crystalis. Just an epic blend of fantasy/sci-fi and action/rpg.Crystalis seems to be one of those hidden gems of the NES. I can''''t remember anyone else ever talking about it and if I asked them about it, they''''d always say they''''d never heard of it. It is certainly worth playing despite its apparent under-popularity. Basically, its Zelda with more RPG qualities added in. You gain levels, use money, and collect weapons and items. All the ', 'nes', '/apps/emulators/jsnes/roms/Crystalis.nes', '/images/roms/nes/Crystalis(1).jpg,/images/roms/nes/Crystalis(2).png,/images/roms/nes/Crystalis(3).jpg,/images/roms/nes/Crystalis(4).png,/images/roms/nes/Crystalis(5).png'),
(73, 'Jackal (USA) ROM ', 'Jackal', 'Konami brings Jackal from the arcades to your home with this NES port. It''''s a an action game where youKonami brings Jackal from the arcades to your home with this NES port. It''''s a an action game where you play as some guys in a jeep that drive around what looks like Vietnam blowing up bad guys and saving prisoners. Some of these prisoners give you power ups that turn your grenades into a rocket launcher which can also be upgraded into a more powerful version.\r\nThis game can get difficult as danger can come out of nowhere and dying means you lose that precious rocket launcher and prisoners that haven''''t been airlifted out yet.', 'nes', '/apps/emulators/jsnes/roms/Jackal.nes', '/images/roms/nes/Jackal(1).png'),
(1049, 'Sonic The Hedgehog (USA, Europe) ROM ', 'Sonic-The-Hedgehog', 'Sonic the Hedgehog (USA, Europe) is a game that was developed and published by Sega. Sonic must defeat Doctor Robotnik in order to save the world from harm.Some Sega Genesis/Megadrive games saw the light on their lower spec conterparts, the Master System and the Game Gear.\nHowever, what saw the light in Sonic 1''''s case was not a direct port of the game but a whole new different experience, with low end graphics, but awesome gameplay.\nThe story of this one installment is the same as its 16-bit counterpart. Dr. Robotnik (Eggman in Japan) is up to no good, trying to dominate the world, so its up for Sonic the Hedgehog to foil his plans.\nIn this installment, the Chaos Emeralds are sparsed in the map, hidden in hard to reach spots. Get them all, finish Robotnik''''s contraptions and you can pat yourself in the back, being conquered a really hard but amusing game.\nDo you like old school platformers? Are you a Sonic fan? Play this game and you''''ll get very satisfied.', 'sms', '/apps/emulators/jssms/roms/Sonic_The_Hedgehog.sms', '/images/roms/sms/Sonic_The_Hedgehog(1).png,/images/roms/sms/Sonic_The_Hedgehog(2).jpg,/images/roms/sms/Sonic_The_Hedgehog(3).png,/images/roms/sms/Sonic_The_Hedgehog(4).png,/images/roms/sms/Sonic_The_Hedgehog(5).png,/images/roms/sms/Sonic_The_Hedgehog(6).png,/images/roms/sms/Sonic_The_Hedgehog(7).jpg,/images/roms/sms/Sonic_The_Hedgehog(8).png,/images/roms/sms/Sonic_The_Hedgehog(9).png'),
(1050, 'Alex Kidd in Miracle World (USA, Europe) ROM ', 'Alex-Kidd-in-Miracle-World', 'Play as the original mascot of Sega, Alex Kidd, as you progress through the Miracle World in order to save Radactian. Alex Kidd will make his way through many different areas as he punches his way through rocks and enemies along the way. A classic for the Master System!', 'sms', '/apps/emulators/jssms/roms/Alex_Kidd_in_Miracle_World.sms', '/images/roms/sms/Alex_Kidd_in_Miracle_World(1).png,/images/roms/sms/Alex_Kidd_in_Miracle_World(2).png,/images/roms/sms/Alex_Kidd_in_Miracle_World(3).png,/images/roms/sms/Alex_Kidd_in_Miracle_World(4).png,/images/roms/sms/Alex_Kidd_in_Miracle_World(5).png,/images/roms/sms/Alex_Kidd_in_Miracle_World(6).jpg,/images/roms/sms/Alex_Kidd_in_Miracle_World(7).jpg'),
