(1055, 'Phantasy Star (USA, Europe) (v1.3) ROM ', 'Phantasy-Star', 'Phantasy Star is a classic among classics for the Sega Master System. It''''s an excellent RPG and one of the first story-driven games of its time! Play as Alis Landale as you trek through the solar system in your mission to defeat the evil tyrant, Lassic. The battle system is turn-based in which you face the enemies and choose your options for attack. ', 'sms', '/apps/emulators/jssms/roms/Phantasy_Star.sms', '/images/roms/sms/Phantasy_Star(1).png,/images/roms/sms/Phantasy_Star(2).png,/images/roms/sms/Phantasy_Star(3).jpg,/images/roms/sms/Phantasy_Star(4).png,/images/roms/sms/Phantasy_Star(5).jpg,/images/roms/sms/Phantasy_Star(6).png,/images/roms/sms/Phantasy_Star(7).png'),
(1056, 'Wonder Boy in Monster Land (USA, Europe) ROM ', 'Wonder-Boy-in-Monster-Land', 'The best arcade to 8-bit console, Ever! you are WonderBoy, and you are Monster land, yay!\nThe game is a linear platform RPG, with very tough arcade elements. You collect money by defeating monsters. you can use that money to buy health, alcoholic beverages (which then the tender gives you helpful advice), and armor! there are a few types of armor, boots, brest plate, and a shield. you must choose wisely what to spend your hard earned cash on, for one purchase can hinder your chances for another, perhaps more important purchase.\nalso, you can get better swords by defeating boss monsters, some are hidden. you only get one life, and a revival potion to begin with. once you run out of health (and the potion), that''''s it. game over, try again! If you plan on beating this one, you''''d better plan on at least a couple of sit downs with it. of course, the more you play, the more you get it.\nOver all, an Excelent game that will keep one occupied for a while.', 'sms', '/apps/emulators/jssms/roms/Wonder_Boy_in_Monster_Land.sms', '/images/roms/sms/Wonder_Boy_in_Monster_Land(1).jpg,/images/roms/sms/Wonder_Boy_in_Monster_Land(2).jpg,/images/roms/sms/Wonder_Boy_in_Monster_Land(3).jpg,/images/roms/sms/Wonder_Boy_in_Monster_Land(4).jpg,/images/roms/sms/Wonder_Boy_in_Monster_Land(5).jpg,/images/roms/sms/Wonder_Boy_in_Monster_Land(6).jpg,/images/roms/sms/Wonder_Boy_in_Monster_Land(7).jpg,/images/roms/sms/Wonder_Boy_in_Monster_Land(8).jpg,/images/roms/sms/Wonder_Boy_in_Monster_Land(9).jpg,/images/roms/sms/Wonder_Boy_in_Monster_Land(10).jpg'),
(1057, 'Golden Axe Warrior (USA, Europe) ROM ', 'Golden-Axe-Warrior', 'Golden Axe Warrior is an excellent action RPG for the Master System. You, playing as the hero, must set out to defeat the evil DeathGolden Axe Warrior is an excellent action RPG for the Master System. You, playing as the hero, must set out to defeat the evil Death Adder who is taking over the world! Pick up your sword and start stabbing your enemies in one of the best RPGs for the Master System.This game is really fun in so many ways! Although you can really see the resemblance to Zelda, it grabs almost everything we though Zelda did amazingly, and makes it a whole lot better! The game is very well made and is an excellent challenge for people looking for one.', 'sms', '/apps/emulators/jssms/roms/Golden_Axe_Warrior.sms', '/images/roms/sms/Golden_Axe_Warrior(1).png,/images/roms/sms/Golden_Axe_Warrior(2).jpg,/images/roms/sms/Golden_Axe_Warrior(3).png,/images/roms/sms/Golden_Axe_Warrior(4).png,/images/roms/sms/Golden_Axe_Warrior(5).png,/images/roms/sms/Golden_Axe_Warrior(6).png'),
(1058, 'Alex Kidd in Shinobi World (USA, Europe) ROM ', 'Alex-Kidd-in-Shinobi-World', 'This is Alex Kidd''''s last game in which he stars. the story: you (Alex) are hanging out with your girlfriend in this beautiful flower-filled ...This is Alex Kidd''''s last game in which he stars. the story: you (Alex) are hanging out with your girlfriend in this beautiful flower-filled ...field. all of a sudden, she gets kidnaped by a strange floating evil guy! you kneel and weep, as the land turns dark. Then, you see a white ninja-like guy float above you, he explains the background between him (Shinobi) and the mysterious monster. As only a ghost, he gives his power to you, his sword, suit, and skills in tact.\nthe gameplay is fairly familiar, you move left and right, jump and attack. the levels are similat to those of the previous Shinobi game by Sega, the enemies are tough, but predictable. Like most games on a classic Sega console, you will probabaly die constantly, until you start to get the gist of things.\nOver all, a good game for Sega and platformer Fans.', 'sms', '/apps/emulators/jssms/roms/Alex_Kidd_in_Shinobi_World.sms', '/images/roms/sms/Alex_Kidd_in_Shinobi_World(1).jpg,/images/roms/sms/Alex_Kidd_in_Shinobi_World(2).png,/images/roms/sms/Alex_Kidd_in_Shinobi_World(3).png'),
(1059, 'Sonic Chaos (Europe) ROM ', 'Sonic-Chaos', 'The third installment of Sonic''''s adventures on the Sega Master System and GameThe third installment of Sonic''''s adventures on the Sega Master System and Game Gear revamped completely the series for these two systems.\nFirst, you could finally play with Tails, Sonic''''s faithful sidekick, even including his trademark two-tailed flying ability. Second, chaos emeralds were no longer hidden around the world, but this time you would have to arrive to the end of a stage with 100 rings or more.\nThe plot this time follows the same idea behind its predecessors. It''''s also very important to emphasize that this particular game has no relation to any game in the 16-bits era.\nA nice little platformer by itself, only hindered by the small screen resolution and some slightly wacky controllers. Other than that, a gem of the Master System/Game Gear Sonic series.', 'sms', '/apps/emulators/jssms/roms/Sonic_Chaos.sms', '/images/roms/sms/Sonic_Chaos(1).jpg,/images/roms/sms/Sonic_Chaos(2).jpg,/images/roms/sms/Sonic_Chaos(3).jpg,/images/roms/sms/Sonic_Chaos(4).jpg,/images/roms/sms/Sonic_Chaos(5).jpg,/images/roms/sms/Sonic_Chaos(6).jpg,/images/roms/sms/Sonic_Chaos(7).jpg,/images/roms/sms/Sonic_Chaos(8).jpg,/images/roms/sms/Sonic_Chaos(9).jpg,/images/roms/sms/Sonic_Chaos(10).jpg'),
