(1107, 'Land of Illusion Starring Mickey Mouse (Europe) ROM ', 'Land-of-Illusion-Starring-Mickey-Mouse', 'Land of Illusion (1992) for Sega Master System was the sequel to Castle of Illusion, both starring Mickey Mouse. This game has plenty of great platforming plus terrific graphics and controls compared to games from this time period.', 'sms', '/apps/emulators/jssms/roms/Land_of_Illusion_Starring_Mickey_Mouse.sms', '/images/roms/sms/Land_of_Illusion_Starring_Mickey_Mouse(1).jpg'),
