(1109, 'Castle of Illusion Starring Mickey Mouse (USA) ROM ', 'Castle-of-Illusion-Starring-Mickey-Mouse', 'Sega, you suck!\r\nDisney, You SUCK!!!\r\nSega + Disney = A collision of AWSOME!\r\nSeriously! This game is probably the Best thing to happen to SEGA ever since they made SONIC!\r\nThe platforming is Perfect, the Graphics are smooth, colorful and fun, and the level design is nothing to be ignored! If I had A say, I''''d put Disney and SEGA on the same computer interactive software team. (I know Disney workers helped with the graphics and music, then Sega made a game from it...)\r\n*Heave*... Money and Popularity kills great things fast.\r\nanyway, try it, you''''ll like it!', 'sms', '/apps/emulators/jssms/roms/Castle_of_Illusion_Starring_Mickey_Mouse.sms', '/images/roms/sms/Castle_of_Illusion_Starring_Mickey_Mouse(1).jpg'),
