(1112, 'Master of Darkness (Europe) ROM ', 'Master-of-Darkness', 'Master of Darkness also known as Vampires plays very similar to the early Castelvania games. Instead of a whip Dr. Social uses a variety of weapons ranging from a paltry knife to a hammer. Like Castlevania there are subweapons and they are a little more conventional such as a gun and bombs as opposed to throwing daggers and axes. Master of Darkness gives youcomplete control over jumping unlike Castlevania and you can even jump on stairs. Think of Masters of Darkness as a more refined NES Castlevania and you have a winner.', 'sms', '/apps/emulators/jssms/roms/Master_of_Darkness.sms', ''),
